import React from "react";
import ServicesCard from "./ServicesCard";
import { Col } from "reactstrap";
import offer2 from "../assets/images/offer2.webp";
import offer3 from "../assets/images/offer3.avif";
import offer1 from "../assets/images/offer1.jpeg"

const servicesData = [
  {
    imgurl: offer1,
    title: "New Year, New Adventures",
    desc: "Save 15% Or More When You Book And Stay Before April 1, 2024",
  },
  {
    imgurl: offer2,
    title: "Get Instant Discounts",
    desc: "Just Sign Into Your Booking.com Account",
  },
  {
    imgurl: offer3,
    title: "Ayodhya Special",
    desc: "Enjoy Epic Offers On Booking Buses, Cabs & Trains",
  },
];

const ServicesList = () => {

  return (
    <>
        {servicesData.map((item, index) => (
          <Col lg="12" key={index}>
            <ServicesCard item={item} />
          </Col>
        ))}
    </>
  );
};

export default ServicesList;
